Sekmadienį dvylika dalyvių susikovė dėl galimybės patekti į kitą etapą. Dalyvių likimas buvo tik žiūrovų rankose ir tik savo balsais jie galėjo nuspręsti, kas keliaus toliau projekte, o kurie du savo kelią „Lietuvos balse“ turės pabaigti. Laidos pabaigoje paaiškėjo, kad projektą paliko radijo laidų vedėjas Petras Daunys ir profesionalus operos dainininkas Andrius Bartkus. Tačiau šįkart daugiausiai dėmesio sulaukė atlikėjas Gražvydas Sidiniauskas, mat pasirodymo metu įvyko klaida: ekrano apačioje degęs jo numeris 08 staiga pasikeitė į 02, tad dalis gerbėjų tuo metu galėjo prabalsuoti už visai kitą „Lietuvos balso“ dalyvį, kurio tikrasis numeris tą vakarą ir buvo 02. Tiesa, ši klaida galbūt ir lėmė kitokį balsų skaičių galutinėje lentelėje, tačiau didelės įtakos rezultatams neturėjo - Gražvydas liko projekte. Šią laidos kūrėjų klaidą pastebėjo ir atlikėja Mia. Ji savo paskyroje feisbuke paviešino vaizdo įrašą, kuriame aiškiai matosi skaičių pasikeitimas. „Atkreipkit dėmesį į balsavimo numerį! Čia normalu? Po to jis vėl stebuklingai tampa 08... Nuoširdžiai? Manęs jau niekas nebestebina. Pusę dainos vienu numeriu balsuojam, o kitą pusę kitu numeriu. Paskui žiūri ir nesupranti, kokiu numeriu čia reikėjo balsuot? Aaa, 08“, – prie įrašo pasipiktino Mia. (function(d, s, i, r) {
